def profile_most_probable_kmer(text, k, profile):
    max_probability = -1
    most_probable_kmer = text[:k]

    for i in range(len(text) - k + 1):
        kmer = text[i:i+k]
        probability = 1
        for j, nucleotide in enumerate(kmer):
            probability *= profile[nucleotide][j]
        if probability > max_probability:
            max_probability = probability
            most_probable_kmer = kmer

    return most_probable_kmer

# Example usage
text = ""
k = 15
profile = {
    'A': [0.318, 0.273, 0.242, 0.303, 0.242, 0.227, 0.273, 0.288, 0.212, 0.167, 0.258, 0.212, 0.303, 0.227, 0.197],
    'C': [0.242, 0.136, 0.273, 0.242, 0.258, 0.273, 0.288, 0.197, 0.273, 0.303, 0.258, 0.485, 0.227, 0.303, 0.348],
    'G': [0.227, 0.348, 0.197, 0.227, 0.242, 0.242, 0.212, 0.242, 0.167, 0.303, 0.273, 0.152, 0.273, 0.212, 0.242],
    'T': [0.212, 0.242, 0.288, 0.227, 0.258, 0.258, 0.227, 0.273, 0.348, 0.227, 0.212, 0.152, 0.197, 0.258, 0.212]
}

result = profile_most_probable_kmer(text, k, profile)
print("Profile-most probable k-mer:", result)